import React from "react";

const Models = () => (
  <div>
    <br />
    <ul>
      <h1>Models</h1>
      <br />


      <p>
        Whenever possible Resilience Visitation seeks to use evidence-based
        models as we work with families.
      </p>
      <p>
        We use Mary Beyerâ€™s{" "}
        <a href="https://www.visitcoachingcommunity.com/about">
          {" "}
          Visit Coaching{" "}
        </a>
        model to facilitate most of our visits. This model includes:
      </p>
      <li>
        Helping parents articulate their children's needs to be met in visits
      </li>
      <li>Preparing parents for their children's reactions</li>
      <li>
        Helping parents plan to give their children their full attention at each
        visit
      </li>
      <li>
        Helping parents cope with their feelings so that they can visit
        consistently and keep their anger and sadness out of the visit
      </li>
      <br />
      <p>
        Visit Coaching is adaptable to many different situations and allows us
        to flexibility to meet each familyâ€™s unique needs while providing the
        support parents need to remain attuned to their childrenâ€™s needs in
        extraordinarily stressful circumstances.{" "}
      </p>

      <img src="pic/04.jpg" style={{ width: "80%" }} />
      <br/>
      <br/>
      <br/>
      <p style={{marginLeft: "20px"}}>
       <h4> We use <a href="https://safecare.publichealth.gsu.edu/about-safecare/">SafeCare</a> as a vehicle to ensure that parents of young children
        have basic parenting skills.</h4> SafeCare is a home-visiting program for
        families with children ages 0-5. It focuses on creating positive
        relationships between caregivers and their children, ensuring homes are
        safe to reduce the risk of child unintentional injury and keeping
        children as healthy as possible. SafeCare is typically completed over
        the course of 18 weekly sessions. Each session lasts approximately one
        hour.
      </p>
      <br />
      <br />
      <br />
      <h2>Sadly at this time we are unable to take on any more clients. </h2>
    </ul>
  </div>
);

export default Models;

